"     Reported Use",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Treatment of hyperthyroidism",
"    </p>",
"   </div>",
"   <div class=\"block idos drugH1Div\" id=\"F1977922\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosage Range",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Adults: Oral: Initial: 150-200 mg/day in 3-4 divided doses; may decrease to 100 mg/day after several weeks",
"    </p>",
"   </div>",
"   <div class=\"block prod-avail drugH1Div\" id=\"F11821220\" xmlns=\"file://www.w3.org/1999/xhtml\">",
