"       <sup>",
"        2",
"       </sup>",
"      </td>",
"      <td rowspan=\"2\">",
"       20",
"      </td>",
"      <td rowspan=\"2\">",
"       TBI: 13.2 Gy in 11 fractions over 4 days",
"      </td>",
"      <td>",
"       OND (8 mg x 3/day PO)",
"      </td>",
"      <td>",
"       50",
