"      </td>",
"      <td rowspan=\"2\">",
"       30",
"      </td>",
"      <td rowspan=\"2\">",
"       7.5 Gy (TBI, single fraction)",
"      </td>",
"      <td>",
"       GRAN (3 mg IV)",
"      </td>",
"      <td>",
"       53",
"      </td>",
"      <td rowspan=\"2\">",
"       GRAN better than MTC + DEX + LOR",
"      </td>",
"     </tr>",
