"       </sup>",
"      </td>",
"      <td rowspan=\"2\">",
"       116",
"      </td>",
"      <td rowspan=\"2\">",
"       7 to 7.7 Gy (TBI, single fraction)",
"      </td>",
"      <td>",
"       OND (8 mg) + DEX (10 mg)",
"      </td>",
"      <td>",
"       84",
"      </td>",
"      <td rowspan=\"2\">",
"       OND + DEX better than MCP + DEX",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       MCP (10 mg) + DEX (10 mg)",
"      </td>",
"      <td>",
"       20",
