"     </tr>",
"     <tr>",
"      <td rowspan=\"2\">",
"       Sykes",
"       <sup>",
"        5",
"       </sup>",
"      </td>",
"      <td rowspan=\"2\">",
"       66",
"      </td>",
"      <td rowspan=\"2\">",
"       8 to 12.5 Gy (HBI, single fraction)",
"      </td>",
"      <td>",
"       OND (8 mg x 2 PO)",
"      </td>",
"      <td>",
"       94",
"      </td>",
