"      </td>",
"      <td>",
"       61",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     TBI: total body irradiation; HBI: hemibody irradiation; OND: ondansetron; GRAN: granisetron; MCP: metoclopramide; LOR: lorazepam; CLP: chlorpromazine; DEX: dexamethasone; PO: orally; IV: intravenously from (2009).",
"     <br>",
"      * All patients received intravenous dexamethasone (8 mg) and phenobarbitone (60 mg/m2).",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     1. Tiley, C, et al. Leuk Lymphoma 1992; 7:317.",
"     <br>",
